import ReactDOM from 'react-dom';
import'./BFS.css';
export default class BFS extends  React.Component{

    constructor(props)
    {
        super(props);
        this.state={
            hexSize:20
        }
    } 
  
    render(){
        return (
            <div className="BFS">
                <canvas ref={canvasHex=>this.canvasHex = canvasHex}></canvas>
            </div>
        )
    }
}
